	(356, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '50', 'user_action', NULL, NULL, false, '{"id": 50, "name": "Rework (Future)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the effectiveness and quality of how we executed work during the planned and scheduled period. With quality assurance checks we control the risk of re-work, which is a source of waste and risk of unnecessary downtime/failure.", "created_at": "2025-09-08T04:19:52.376834+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.376834+00:00", "calculation": "Rework = M2 Notifications by RDC <= 5 Days / All M2 Notifications", "description": "A notification raised by RDC within 5 days after depot maintenance, measured across all notifications raised, is an indication our maintenance is not being carried out with quality checks.", "calculation_type": "ratio", "required_csv_columns": [{"name": "notification_creation_date", "data_type": "date", "description": null}, {"name": "notification_id", "data_type": "string", "description": null}, {"name": "work_order_completion_date", "data_type": "date", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 50, "name": "Rework (Future)", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the effectiveness and quality of how we executed work during the planned and scheduled period. With quality assurance checks we control the risk of re-work, which is a source of waste and risk of unnecessary downtime/failure.", "created_at": "2025-09-08T04:19:52.376834+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:52.376834+00:00", "calculation": "Rework = M2 Notifications by RDC <= 5 Days / All M2 Notifications", "description": "A notification raised by RDC within 5 days after depot maintenance, measured across all notifications rais