	(359, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '53', 'user_action', NULL, NULL, false, '{"id": 53, "name": "Scheduled Loading", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view planned utilisation of labour on scheduled work compared to all labour available and the effective use of the work order management system in managing labour.", "created_at": "2025-09-08T04:19:53.222016+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.222016+00:00", "calculation": "Schedule Loading = Total Estimated Work Hours / Total Work Hours Available", "description": "It is defined as the percentage of total estimated work hours on scheduled work orders for the scheduling period compared to total available manhours for the scheduling period.", "calculation_type": "ratio", "required_csv_columns": [{"name": "estimated_work_hours", "data_type": "number", "description": null}, {"name": "scheduled_end_date", "data_type": "date", "description": null}, {"name": "scheduled_start_date", "data_type": "date", "description": null}, {"name": "total_work_hours_available", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 53, "name": "Scheduled Loading", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view planned utilisation of labour on scheduled work compared to all labour available and the effective use of the work order management system in managing labour.", "created_at": "2025-09-08T04:19:53.222016+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.222016+00:00", "calculation": "Schedule Loading = Total Estimated Work Hours / Total Work Hours Available", "description": "It is defined as the percentage of total estimated work hours on scheduled work orders for the scheduling period compared to total available manhours for t