	(360, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '54', 'user_action', NULL, NULL, false, '{"id": 54, "name": "Material Demand Forecast (Future)", "unit": null, "active": false, "provider": "other", "max_value": null, "min_value": null, "objective": "To view inventory effectiveness with demand forecasting.", "created_at": "2025-09-08T04:19:53.550942+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.550942+00:00", "calculation": "Material Demand Forecast = Total Materials meet Forecast Date / Total All Materials", "description": "The percentage of materials that are ordered with a requirement date compared to the expected delivery time. Materials are measured as a count.", "calculation_type": "ratio", "required_csv_columns": [{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "forecast_date", "data_type": "date", "description": null}, {"name": "material_id", "data_type": "string", "description": null}, {"name": "order_date", "data_type": "date", "description": null}]}', '{"id": 54, "name": "Material Demand Forecast (Future)", "unit": null, "active": false, "provider": "other", "max_value": 1, "min_value": 0, "objective": "To view inventory effectiveness with demand forecasting.", "created_at": "2025-09-08T04:19:53.550942+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.550942+00:00", "calculation": "Material Demand Forecast = Total Materials meet Forecast Date / Total All Materials", "description": "The percentage of materials that are ordered with a requirement date compared to the expected delivery time. Materials are measured as a count.", "calculation_type": "ratio", "required_csv_columns": [{"name": "delivery_date", "data_type": "date", "description": null}, {"name": "forecast_date", "data_type": "date", "description": null}, {"name": "material_id", "data_type": "string", "description": null}, {"name": "order_date", "data_type": "date", "description"