	(361, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '55', 'user_action', NULL, NULL, false, '{"id": 55, "name": "Corrective Work Task List Usage (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view whether task lists are used on corrective work orders that enable effective execution of planned maintenance work.", "created_at": "2025-09-08T04:19:53.858233+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.858233+00:00", "calculation": "Corrective Work Task List Usage = Corrective Work Orders Closed with Task Lists / All Corrective Work Orders Closed", "description": "A ratio of corrective work orders with task list on them measured against all corrective work orders.", "calculation_type": "ratio", "required_csv_columns": [{"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_status", "data_type": "string", "description": null}, {"name": "work_order_type", "data_type": "string", "description": null}]}', '{"id": 55, "name": "Corrective Work Task List Usage (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view whether task lists are used on corrective work orders that enable effective execution of planned maintenance work.", "created_at": "2025-09-08T04:19:53.858233+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:53.858233+00:00", "calculation": "Corrective Work Task List Usage = Corrective Work Orders Closed with Task Lists / All Corrective Work Orders Closed", "description": "A ratio of corrective work orders with task list on them measured against all corrective work orders.", "calculation_type": "ratio", "required_csv_columns": [{"name": "task_list_id", "data_type": "string", "description": null}, {"name": "work_order_id", "data_type": "string", "descri