	(364, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '60', 'user_action', NULL, NULL, false, '{"id": 60, "name": "Labour Wait Time (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the time spent by maintenance personnel waiting for assets to be delivered for scheduled maintenance.", "created_at": "2025-09-08T04:19:55.288649+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:55.288649+00:00", "calculation": "Labour Wait Time = Total Hours Time Confirmations for Waiting / Total All Time Confirmations", "description": "Capture total time confirmations from standing work orders that have text reference delayed due to operations divided by all time confirmations to provide a percentage of time spent waiting.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "date", "description": null}, {"name": "time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}, {"name": "work_order_text", "data_type": "string", "description": null}]}', '{"id": 60, "name": "Labour Wait Time (Manual)", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the time spent by maintenance personnel waiting for assets to be delivered for scheduled maintenance.", "created_at": "2025-09-08T04:19:55.288649+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:55.288649+00:00", "calculation": "Labour Wait Time = Total Hours Time Confirmations for Waiting / Total All Time Confirmations", "description": "Capture total time confirmations from standing work orders that have text reference delayed due to operations divided by all time confirmations to provide a percentage of time spent waiting.", "calculation_type": "ratio", "required_csv_columns": [{"name": "completion_date", "data_type": "d