	(365, NULL, NULL, NULL, NULL, 'UPDATE', 'measurement_definitions', '61', 'user_action', NULL, NULL, false, '{"id": 61, "name": "Labour Estimate Accuracy", "unit": null, "active": false, "provider": "SAP", "max_value": null, "min_value": null, "objective": "To view the accuracy of the work order planning and scheduling function and the effectiveness of the work order feedback process.", "created_at": "2025-09-08T04:19:55.592948+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:55.592948+00:00", "calculation": "Labour Estimate Accuracy = Total Hours Actual Time Confirmations for all Operations / Total Hours Planned Time Confirmations for all Operations", "description": "A ratio of the sum of actual labour hours for all work order operations completed for that period to the sum of planned labour hours for all work order operations completed  expressed as a percentage.", "calculation_type": "ratio", "required_csv_columns": [{"name": "actual_time_confirmation_hours", "data_type": "number", "description": null}, {"name": "completion_date", "data_type": "date", "description": null}, {"name": "planned_time_confirmation_hours", "data_type": "number", "description": null}, {"name": "work_order_id", "data_type": "string", "description": null}]}', '{"id": 61, "name": "Labour Estimate Accuracy", "unit": null, "active": false, "provider": "SAP", "max_value": 1, "min_value": 0, "objective": "To view the accuracy of the work order planning and scheduling function and the effectiveness of the work order feedback process.", "created_at": "2025-09-08T04:19:55.592948+00:00", "deleted_at": null, "is_deleted": false, "updated_at": "2025-09-08T04:19:55.592948+00:00", "calculation": "Labour Estimate Accuracy = Total Hours Actual Time Confirmations for all Operations / Total Hours Planned Time Confirmations for all Operations", "description": "A ratio of the sum of actual labour hours for all work order operations completed for that period to the sum of plann