	(1239, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '65', 'user_action', NULL, NULL, false, '{"id": 65, "title": "Maintenance Request / Notification Process", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:07:37.947273+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:07:37.947273+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 45}', '{"id": 65, "title": "Maintenance Request / Notification Process", "context": "All work requests are  recorded in the SAP as Notifications. This includes identifying work found as a result of  Reliability inspections.  \nAdequate information to process the notification is included:\n   What:   A description of the fault or request for maintenance, including any troubleshooting performed\n  Where:  Identifies the maintainable item requiring maintenance\n  When:   Pinpoints when the fault occurred and sets the priority for the task \nto be performed\n  Why:  Relates why the work need to be performed (failure modes)", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:07:37.947273+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:32:40.204+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 45}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:32:40.210883+00'),
	(1256, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '81', 'user_action', NULL, NULL, false, '{"id": 81, "title": "Available Resources", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:43.05263+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:10:43.05263+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{"id": 81, "title": "Available Resources", "context": "Effective scheduling of work requires control of resources including contractors utilising the following:\n Leave guidelines\n Training guidelines and/or competencies\n Use of available system functionality (preferable),\n Use of manual resource tracking tool\n Alliance contractor work centres are set-up and managed", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:43.05263+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:37:00.893+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:37:00.899741+00'),
	(734, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '62', 'user_action', NULL, NULL, false, '{"id": 62, "title": "Identification of PM work", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:05:30.142998+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:06:03.206+00:00", "order_index": 2, "question_text": "123", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 45}', '{"id": 62, "title": "Identification of PM work", "context": "PM Work has a defined scope and frequency, and originates from the asset maintenance strategy, and built into its maintenance tactics. The maintenance tactics are a set of activities carried out to enable the realisation of the defined reliability/availability of the Asset. All maintenance strategies and tactics are created within the SAP for automatic generation as PM01", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:05:30.142998+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:06:06.447+00:00", "order_index": 2, "question_text": "123", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 45}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:06:06.451981+00'),
