  What is the process for entering them into the SAP? \n4.   What is the process for modifications to existing tactics, and entering them into the SAP?   How often are formal reviews undertaken?\n5. Preventative work orders are part of the maintenance regime (PM02)", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 45}', '{question_text}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:06:14.756326+00'),
