	(1258, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '83', 'user_action', NULL, NULL, false, '{"id": 83, "title": "Scheduling Review/Lock in Meetings", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:59.244261+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:10:59.244261+00:00", "order_index": 4, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{"id": 83, "title": "Scheduling Review/Lock in Meetings", "context": "There should be formal ''schedule'' meetings.\n Operations and maintenance sit down to discuss the proposed schedule. This is done in tandem with the operations schedule. Any active discussions regarding schedule inclusions should happen at this meeting.\n The teams get back together to formally lock down the schedule. This discussion should be a formality and should rarely involve disagreements on the schedule inclusions. The timing of the second meeting is usually dictated by the lock-down date in the SAP.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:59.244261+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:37:28.889+00:00", "order_index": 4, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:37:28.895946+00'),
