	(1246, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '72', 'user_action', NULL, NULL, false, '{"id": 72, "title": "Long Term Planning Horizons & Tasks", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:09:47.861652+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:09:47.861652+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{"id": 72, "title": "Long Term Planning Horizons & Tasks", "context": "Capital Planning tasks are managed by Long Term Planning (26 weeks to 3 weeks).  Clear differentiation of maintenance tasks required to assign maintenance planner form Asset Management & Strategy or Business Unit.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:09:47.861652+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:34:40.378+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:34:40.383874+00'),
	(1251, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '77', 'user_action', NULL, NULL, false, '{"id": 77, "title": "Material Management - Process", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:19.956875+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:10:19.956875+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{"id": 77, "title": "Material Management - Process", "context": "An effective parts management process incorporates the following criteria. \n Up to date Bill of Material (BOM''s) & inventory levels          \n Parts ordered from BOM''s, or updated if not\n Correct requisitioning, to the correct work order and use of lead times\n Effective Planner / Warehouse communications\n Parts tracking monitored                                                                                                         Use of Materials Availability reporting, if available", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:10:19.956875+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:35:20.408+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:35:20.41403+00'),
	(1260, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '85', 'user_action', NULL, NULL, false, '{"id": 85, "title": "Material Management - Scheduled Spares", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:11:10.52945+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:11:10.52945+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{"id": 85, "title": "Material Management - Scheduled Spares", "context": "Best practice would see materials managed using a Just-in-Time philosophy. This minimises stocked inventory and, in turn costs. However, particularly for isolated depot/P&Es with potential supply chain logistics issues, this is not always practical.\nIt is accepted that, in order to reduce the risks presented by these issues Aurizon depot/P&Es should be protecting their maintenance schedules by ensuring spares and materials are on depot/P&E before the Operations are scheduled.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:11:10.52945+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:37:52.457+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:37:52.462649+00'),
