	(1247, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '73', 'user_action', NULL, NULL, false, '{"id": 73, "title": "Task List / Standard Jobs", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:09:55.837657+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:09:55.837657+00:00", "order_index": 3, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{"id": 73, "title": "Task List / Standard Jobs", "context": "To reduce the amount of work, and support continuous improvement, standard jobs or task lists should be used during the planning process.\nA Job should only ever be planned once, saved as a task list or standard job, and then improved over time.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:09:55.837657+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:34:46.763+00:00", "order_index": 3, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 46}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:34:46.768817+00'),
