	(1261, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '86', 'user_action', NULL, NULL, false, '{"id": 86, "title": "Weekly Schedule (Quality) Output", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:11:16.470178+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:11:16.470178+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{"id": 86, "title": "Weekly Schedule (Quality) Output", "context": "Priorities of work to be determined based on set guidelines and in line with maintenance and operations requirements considering:\n Input based on operations objectives\n Safety / Environmental priorities\n Support equipment availability\n Possible contingency plans                                        \n Review of Materials availability                                 \n Schedule needs to be agreed & confirmed                          \n Work packages and/or job cards are part of published schedule", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:11:16.470178+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:38:03.828+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 47}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:38:03.835757+00'),
