	(1320, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '142', 'user_action', NULL, NULL, false, '{"id": 142, "title": "Key Roles", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:05.135425+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:05.135425+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 58}', '{"id": 142, "title": "Key Roles", "context": "Key Roles are important for the development and implementation of tactics development analyses and their sustainability. Key Roles are:\n Process Owner \n Process Champion or Sponsor\n Asset Tactic Development Analyst.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:05.135425+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:50:03.617+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 58}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:50:03.621584+00'),
	(1321, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '143', 'user_action', NULL, NULL, false, '{"id": 143, "title": "Tactics development Training", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:07.586253+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:07.586253+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 58}', '{"id": 143, "title": "Tactics development Training", "context": "Suitable Asset Tactic Development methodologies require properly trained and experienced personnel to ensure the effectiveness of the Asset Tactic Development program.  Training should be ongoing and include training plans for:\n Management\n Asset Tactic Development practitioners\n Team Members.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:07.586253+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:50:20.666+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 58}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:50:20.670617+00'),
	(1322, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '144', 'user_action', NULL, NULL, false, '{"id": 144, "title": "Decision History", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:14.271228+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:14.271228+00:00", "order_index": 1, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 59}', '{"id": 144, "title": "Decision History", "context": "It is important to record the decision-making history behind tasks and intervals used in a maintenance strategy.  This will facilitate:\n Review and updating of tactics\n Identifying gaps in information needs.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:14.271228+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:53:21.609+00:00", "order_index": 1, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 59}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:53:21.613496+00'),
	(1323, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '145', 'user_action', NULL, NULL, false, '{"id": 145, "title": "Asset Tactic Development-Critical Equipment Tactics", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:24.044914+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:24.044914+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 59}', '{"id": 145, "title": "Asset Tactic Development-Critical Equipment Tactics", "context": "Tasks and associated intervals recorded in a Tactics database should reflect the actual maintenance strategies in use:\n Tasks (and intervals) for critical equipment should exist in the Asset Tactic Development database\n Tasks for critical equipment should have had some level of FMECA/RCM analysis.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:24.044914+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:53:28.896+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 59}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:53:28.902633+00'),
	(1324, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '146', 'user_action', NULL, NULL, false, '{"id": 146, "title": "Document Design", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:29.744628+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:29.744628+00:00", "order_index": 1, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{"id": 146, "title": "Document Design", "context": "Tasks effectiveness is influenced in how they are presented as service sheets or other such documentation. Documentation guidelines should exist as:\n Standard templates\n Standard terminology\n Clearly defined fields for feedback\n Methods of emphasis.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:29.744628+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:54:10.137+00:00", "order_index": 1, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:54:10.143946+00'),
	(1325, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '147', 'user_action', NULL, NULL, false, '{"id": 147, "title": "Field Validation", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:31.975835+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:31.975835+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{"id": 147, "title": "Field Validation", "context": "First time execution of a changed or newly created tactic must be evaluated in the field. Not validating tasks in the field will lead to ineffective tactics and a lack of confidence in the entire program.\nField validation should focus on ensuring:\n Safety, Ergonomic or Environmental issues resolved\n Proper sequencing of tasks\n Equipment access issues\n Identify tools and parts requirements\n Identify training needs.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:31.975835+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:54:14.237+00:00", "order_index": 2, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:54:14.243609+00'),
	(1326, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '148', 'user_action', NULL, NULL, false, '{"id": 148, "title": "Task Packaging", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:37.636448+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:23:37.636448+00:00", "order_index": 3, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{"id": 148, "title": "Task Packaging", "context": "Tasks must integrate with the current maintenance program.  Careful consideration must be taken to how tasks are packaged and scheduled in the maintenance program.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:23:37.636448+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:54:22.397+00:00", "order_index": 3, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 60}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:54:22.402938+00'),
