	(1332, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '153', 'user_action', NULL, NULL, false, '{"id": 153, "title": "Asset Tactics Integrated with Defect Elimination", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:06.570307+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:06.570307+00:00", "order_index": 4, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 153, "title": "Asset Tactics Integrated with Defect Elimination", "context": "A process exists to ensure recommendations for tactics improvement generated from the Defect Elimination process are reviewed and incorporated into existing asset tactics.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:06.570307+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:09.285+00:00", "order_index": 4, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:09.290667+00'),
	(1334, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '155', 'user_action', NULL, NULL, false, '{"id": 155, "title": "The Asset Tactic Development Process", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:15.892244+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:15.892244+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 155, "title": "The Asset Tactic Development Process", "context": "To sustainably manage and improve the Asset Tactics the organisation should have a clearly defined and documented Asset Tactics Development (AS&T) process.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:15.892244+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:22.411+00:00", "order_index": 6, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:22.415771+00'),
	(1333, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '154', 'user_action', NULL, NULL, false, '{"id": 154, "title": "Senior Management Support", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:10.831376+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:10.831376+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 154, "title": "Senior Management Support", "context": "Management support is needed to ensure the process is producing results and can continue to improve.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:10.831376+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:16.801+00:00", "order_index": 5, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:16.808506+00'),
	(1335, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '156', 'user_action', NULL, NULL, false, '{"id": 156, "title": "Links to Work Management", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:21.321871+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:21.321871+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 156, "title": "Links to Work Management", "context": "There should be clearly defined links between the Work Management Analyse Step and Asset Tactic Development to facilitate the review of Tactics identified as possibly not addressing the relevant failure modes. \nThis is one of the key maintenance business improvement steps.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:21.321871+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:29.685+00:00", "order_index": 7, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:29.690521+00'),
	(1336, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '157', 'user_action', NULL, NULL, false, '{"id": 157, "title": "Equipment Modification Review", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:26.622761+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:26.622761+00:00", "order_index": 8, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 157, "title": "Equipment Modification Review", "context": "This process will ensure equipment modifications have been reviewed to ensure they will be supported by the maintenance function prior to being operational.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:26.622761+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:39.807+00:00", "order_index": 8, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:39.812554+00'),
	(1337, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '158', 'user_action', NULL, NULL, false, '{"id": 158, "title": "Acquisition of New Equipment", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:29.363905+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:29.363905+00:00", "order_index": 9, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 158, "title": "Acquisition of New Equipment", "context": "The Asset Tactic Development process should be an integral part of the acquisition of new equipment:\n  Identify costly failure modes\n Ensure maintenance support requirements are met \n  Identify design changes to ensure maintainability\n Determine life cycle expectations\n Develop critical spares listings.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:29.363905+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:46.688+00:00", "order_index": 9, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:46.69425+00'),
	(1338, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '159', 'user_action', NULL, NULL, false, '{"id": 159, "title": "New Technology", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:35.658055+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:35.658055+00:00", "order_index": 10, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 159, "title": "New Technology", "context": "Incorporating  new technologies into the current maintenance plan to reduce reliance on physical inspections and calendar-based maintenance is an important part of the Asset Tactic Development Process.\nThere should be mechanisms in place to prompt a review of Tactics where new or previously unknown technologies are identified.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:35.658055+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:55:53.005+00:00", "order_index": 10, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:55:53.013243+00'),
	(1339, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', '00000000-0000-0000-0000-000000000001', 'tbikaun+vantage_local@teampps.com.au', 'Tyler Bikaun (Test User)', 'UPDATE', 'questionnaire_questions', '160', 'user_action', NULL, NULL, false, '{"id": 160, "title": "Performance Metrics", "context": "Placeholder context", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:42.060685+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:24:42.060685+00:00", "order_index": 11, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{"id": 160, "title": "Performance Metrics", "context": "The Asset Tactic Development program should increase the reliability and performance of equipment under its governance.  Metrics or KPI''s are established to measure the effectiveness and output of the  Asset Tactic Development process and to identify where Tactics may need to be reviewed. Some measures are: \n Equipment performance metrics\n Unscheduled work spend\n  Cost avoidance\n  AR''s completed in a timely manner.", "company_id": "4c23fe1d-5f30-47ae-a292-51d5e8109ecf", "created_at": "2025-11-26T05:24:42.060685+00:00", "created_by": "00000000-0000-0000-0000-000000000001", "deleted_at": null, "is_deleted": false, "updated_at": "2025-11-26T05:56:03.383+00:00", "order_index": 11, "question_text": "", "questionnaire_id": 5, "rating_scale_mapping": null, "questionnaire_step_id": 61}', '{context}', '{"ip": "172.19.0.1", "user_agent": "node", "soft_delete_at": null}', '2025-11-26 05:56:03.388243+00');
