	(69, '2025-11-06 02:12:45.124168+00', '2025-11-06 02:12:45.124168+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'Is there alignment with the checklist details and the maintenance strategies?', 1, 'boolean', '{}', 'b64d182f-0ee3-40a0-b367-281f31902620', 26, 4),
	(71, '2025-11-06 02:13:00.785508+00', '2025-11-06 02:13:05.626+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'Are all defects entered as Notifications in the SAP in a timely manner?', 3, 'boolean', '{}', 'b64d182f-0ee3-40a0-b367-281f31902620', 26, 4),
	(72, '2025-11-06 02:13:10.75184+00', '2025-11-06 02:15:05.157+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'Do notifications typically represent all aspects of the true condition of the equipment?', 4, 'boolean', '{}', 'b64d182f-0ee3-40a0-b367-281f31902620', 26, 4),
	(70, '2025-11-06 02:12:48.256123+00', '2025-11-06 02:16:59.884+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How are changes to inspection requirements and strategies transferred to the checklist?', 2, 'labelled_scale', '{"labels": ["No formal process exists", "Ad-hoc updates when issues are identified", "Periodic review and update process in place", "Systematic change management process with approvals", "Automated system with change tracking and version control"]}', 'b64d182f-0ee3-40a0-b367-281f31902620', 26, 4),
	(73, '2025-11-25 23:53:56.783403+00', '2025-11-25 23:53:56.783403+00', '00000000-0000-0000-0000-000000000001', '2025-11-25 23:54:16.345+00', true, 'How are ''wins'' or ''saves'' acknowledged?', 0, 'labelled_scale', '{"labels": ["Rarely or never", "Occasionally", "Often", "Regularly, through accessible channels"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 58, 5),
	(74, '2025-11-25 23:54:46.633413+00', '2025-11-25 23:54:46.633413+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How are ''wins'' or ''saves'' acknowledged?', 0, 'labelled_scale', '{"labels": ["Rarely or never", "Occasionally", "Often", "Regularly, through accessible channels"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 60, 5),
	(75, '2025-11-25 23:57:56.719139+00', '2025-11-25 23:57:56.719139+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How are changes to the Asset Health program tracked. i.e. changed Fmax from 500Hz to 1000Hz?', 0, 'labelled_scale', '{"labels": ["Scattered and hard to find  Information is stored in various places and difficult to access", "Available but in multiple locations  Stored in specified locations, accessible if you know where to look", "Centralised with limited access  Stored in one location but only certain people can access it", "Centralised and readily accessible  Stored in one location and easily accessible electronically to all who need it"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 27, 5),
	(76, '2025-11-25 23:58:45.471232+00', '2025-11-25 23:58:45.471232+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How do you know what you have?', 0, 'labelled_scale', '{"labels": ["No formal system  Informal process with no documentation", "System exists but not followed  A system is in place but not effectively used", "System mostly followed  Documented system that''s followed most of the time", "System always followed with active champion  Documented system always followed, with an active Asset Health Champion participating in meetings/reviews"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 28, 5),
	(77, '2025-11-25 23:59:35.789958+00', '2025-11-25 23:59:35.789958+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How complete and accessible is the Asset Health equipment inventory? (interpreted)', 0, 'labelled_scale', '{"labels": ["Incomplete or outdated  No formal inventory, or it''s incomplete/out-of-date", "Partial coverage (<50%)  Accessible and up-to-date but covers less than half of equipment", "Good coverage (most equipment)  Accessible and up-to-date covering most equipment", "Complete and current  Readily accessible, complete, and up-to-date inventory"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 29, 5),
	(78, '2025-11-26 00:00:27.656856+00', '2025-11-26 00:00:27.656856+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How would you describe the process for selecting appropriate Asset Health techniques?', 0, 'labelled_scale', '{"labels": ["No formal process  Informal approach, sometimes followed", "Process exists but not used  A process is in place but not utilised", "Process mostly followed  A process is in place and followed most of the time", "Rigorous process always followed  A rigorous process is in place and always followed"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 30, 5),
	(79, '2025-11-26 00:01:06.495122+00', '2025-11-26 00:01:06.495122+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'What level of knowledge exists regarding failure modes?', 0, 'labelled_scale', '{"labels": ["Not well understood  Limited understanding, no rigorous process to apply technologies", "Understood for critical components only  Failure modes understood for critical items but no rigorous application process", "Applied to new equipment only  Failure modes determined for new equipment but not applied to existing equipment", "Comprehensive methodology  Methodology in place for all new and existing equipment with appropriate technologies applied"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 31, 5),
	(80, '2025-11-26 00:01:48.748159+00', '2025-11-26 00:01:48.748159+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'Are we quickly recognising and adopting all suitable and value adding emerging technologies for our condition monitoring program?', 0, 'labelled_scale', '{"labels": ["Informal process  Ad-hoc identification of emerging technologies", "Formal process, inconsistently followed  Formal process exists but not always followed; sometimes leads to improvements", "Formal process, usually followed  Formal process normally followed, often leads to value-adding changes", "Industry leader  Formal process with regular engagement with industry experts; site considered a leader in the field"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 32, 5),
	(81, '2025-11-26 00:05:10.469502+00', '2025-11-26 00:05:10.469502+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How rigorous is the process for selecting equipment to include in the Asset Health program? (interpreted)', 0, 'labelled_scale', '{"labels": ["No process  rely on OEM recommendations  No formal selection process", "Informal/experience-based  Selection based on experience or customer-provided lists", "Formal vendor/consultant review  Formal process where vendors/consultants review equipment", "Rigorous approved process  Approved rigorous process including criticality reviews"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 33, 5),
	(86, '2025-11-26 00:18:55.196321+00', '2025-11-26 00:18:55.196321+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'What percentage of equipment requiring Asset Health monitoring can be accessed safely?', 0, 'percentage', '{}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 34, 5),
	(87, '2025-11-26 00:36:17.044664+00', '2025-11-26 00:36:17.044664+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'How well established are Asset Health inspection routes? (interpreted)', 0, 'labelled_scale', '{"labels": ["Few or none  None to a few routes established", "Critical equipment only  Routes established for critical and some equipment", "Above Rail and Non-rail  Routes established and always followed for Above Rail and Non-rail equipment", "All Aurizon equipment  Routes established and followed for all Aurizon equipment"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 35, 5),
	(88, '2025-11-26 00:36:55.32614+00', '2025-11-26 00:36:55.32614+00', '00000000-0000-0000-0000-000000000001', NULL, false, 'What is the calibration status of your Asset Health equipment? (interpreted)', 0, 'labelled_scale', '{"labels": ["Inconsistent/not calibrated  Some equipment calibrated; some not at all", "Overdue (>3 months)  Equipment is more than 3 months past calibration date", "Overdue but scheduled  Past due but scheduled for calibration", "Fully calibrated  All equipment calibrated per manufacturer recommendations"]}', '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', 36, 5);
