	(61, '2025-11-26 05:02:09.441411+00', '2025-11-26 05:02:28.485+00', 45, '1. How are new employees being trained in Work Identification and Notification creation?
2. Have Operators (if applicable, e.g.. inspection routes) and Maintainers received Work Identification training?
3. Are there any training gaps in your organization regarding entering a work request into your SAP?
4. Have Service Providers / contractors received Work Identification training?', 'Operators / maintainers / Maint professionals / contractors receive training in Work Identification and Notification creation, considering:
 Work identification is incorporated into new employees training
 Sources of training materials may be:
o > Site-specific Work Identification training
o > Work Identification Awareness presentation
o > SAP raising notification training.', 1, '00000000-0000-0000-0000-000000000001', 'Work Identification Training', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(62, '2025-11-26 05:05:30.142998+00', '2025-11-26 05:06:14.749+00', 45, '1.  Is all of the PM Work set up within the SAP?
2.  Is most of the PM work calendar-based, and/or based on OEM recommendations, rather than tactics reviews? 
3.  For new equipment, is PM Work  based on formal Asset Tactics Development?  What is the process for entering them into the SAP? 
4.   What is the process for modifications to existing tactics, and entering them into the SAP?   How often are formal reviews undertaken?
5. Preventative work orders are part of the maintenance regime (PM02)', 'PM Work has a defined scope and frequency, and originates from the asset maintenance strategy, and built into its maintenance tactics. The maintenance tactics are a set of activities carried out to enable the realisation of the defined reliability/availability of the Asset. All maintenance strategies and tactics are created within the SAP for automatic generation as PM01', 2, '00000000-0000-0000-0000-000000000001', 'Identification of PM work', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(63, '2025-11-26 05:06:28.009027+00', '2025-11-26 05:06:46.149+00', 45, '1. Are there Operators'' checklists for all equipment? (Note this refers to inspection checklists, not merely pre-op inspection forms).
2. Is there alignment with the checklist details and the maintenance strategies? How are changes to inspection requirements and strategies transferred to the checklist? 
3. All are all defects entered as Notifications in the SAP in a timely manner?
4. Do Notifications typically represent all aspects of the true condition of the equipment?', 'Operator inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly). Defects found as a result are entered in the SAP in a timely manner considering:
 Safety
 Materials
 Tasks including specification
 Additional Resources
 Feedback / comments field
 Sign off.', 3, '00000000-0000-0000-0000-000000000001', 'Inspection Checklist Design - Operators', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(66, '2025-11-26 05:07:49.589698+00', '2025-11-26 05:32:55.404+00', 45, '', 'Priorities of work being performed must be determined based on set guidelines and in line with maintenance and operational requirements.', 6, '00000000-0000-0000-0000-000000000001', 'Work Request / Notification Priority', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(68, '2025-11-26 05:08:15.522763+00', '2025-11-26 05:33:33.597+00', 45, '', 'The ultimate aim of the identify step is to ensure that the ACTUAL condition of the equipment is captured in the SAP.', 8, '00000000-0000-0000-0000-000000000001', 'Representative of Equipment Condition', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(71, '2025-11-26 05:09:42.696007+00', '2025-11-26 05:34:17.352+00', 46, '', 'To ensure that the planning function is performed in the same manner all the time, well document planning standards for work orders and work management must be in place and followed:
 Workshop visits by planners during planning of major tasks
 Task frequencies and durations captured
 All resource, materials, shared equipment requirements captured
 Safety requirements determined and captured
 Validity of Task reviewed in relation to Tactics
 Additional documentation (checklists) attached', 1, '00000000-0000-0000-0000-000000000001', 'Scoping Work', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(74, '2025-11-26 05:10:01.910079+00', '2025-11-26 05:34:54.345+00', 46, '', 'To enable effective loading of scheduled maintenance tasks, the Workload must be consistently updated, accurate, and include:
 No duplicate tasks and no standing work orders
 Resource requirements including contractors and support equipment
 Task durations
 Intended start date, in the future
 Priorities set.', 4, '00000000-0000-0000-0000-000000000001', 'Backlog / Forward Log Work Management', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(78, '2025-11-26 05:10:23.625792+00', '2025-11-26 05:35:52.497+00', 46, '', 'An effective job consolidation process incorporates the following criteria. 
 Job consolidation (kitting and staging) occurs
 Clearly marked bins
 In time delivery and staging
 Complete and correct parts
 Work order number, req number & materials listing displayed
 Located close to work area', 8, '00000000-0000-0000-0000-000000000001', 'Material Management - Kitting & Staging', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(81, '2025-11-26 05:10:43.05263+00', '2025-11-26 05:37:00.893+00', 47, '', 'Effective scheduling of work requires control of resources including contractors utilising the following:
 Leave guidelines
 Training guidelines and/or competencies
 Use of available system functionality (preferable),
 Use of manual resource tracking tool
 Alliance contractor work centres are set-up and managed', 2, '00000000-0000-0000-0000-000000000001', 'Available Resources', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(84, '2025-11-26 05:11:06.191143+00', '2025-11-26 05:37:38.212+00', 47, '', 'Identified Maintenance strategies/tactics (Corrective & Breakdown) represent work required to increase the reliability of the equipment.  This work should be given high priority when creating the schedule.
Considerations include:
 Breakdown jobs given high priority
 Work order priorities for including work in schedule', 5, '00000000-0000-0000-0000-000000000001', 'Scheduling of Maintenance Strategies/Tactics', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(87, '2025-11-26 05:11:20.497493+00', '2025-11-26 05:38:17.285+00', 48, '', 'To create awareness for oncoming crews an effective handover / turnover process must be in place and address the following:
 Participated by all relevant personnel
 Current progress on planned work
 Possible operations requirements during shift
 Causes for delays, if any
 Changes in environment / risks
 Additional faults / defects found
 Work packages handed out and reviewed as required', 0, '00000000-0000-0000-0000-000000000001', 'Daily Shift Start / Shift Handover', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(89, '2025-11-26 05:11:30.957566+00', '2025-11-26 05:38:34.895+00', 48, '', 'Priority should be given to performing scheduled work and schedule interruptions must be managed and based on interactions between maintenance and operations.', 2, '00000000-0000-0000-0000-000000000001', 'Urgent or Unscheduled Work', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(92, '2025-11-26 05:11:49.547623+00', '2025-11-26 05:39:30.045+00', 48, '', 'Monitoring the productivity of the maintenance crews will ensure the completion of maintenance activities as per the plan and schedule and efficient use of opportune time.  This is achieved by monitoring and reporting:
 Planned vs. Actual Performance
 Rework
 Work quality interaction', 5, '00000000-0000-0000-0000-000000000001', 'Productivity & Quality', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(94, '2025-11-26 05:12:13.482679+00', '2025-11-26 05:39:54.776+00', 49, '', 'For continuous analysis of failures, the feedback from maintainers into SAP is critical and must include:
 Detailed information on work execution
 Failure modes, causes, parts used and delays recorded    
 Actual time worked (tool-time)', 1, '00000000-0000-0000-0000-000000000001', 'Record Maintenance History', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(95, '2025-11-26 05:12:18.631216+00', '2025-11-26 05:39:59.82+00', 49, '', 'The accurate capturing of time actually worked is critical. This will allow for:
 The optimisation of planned labour hours on future tasks
 The correct labour cost allocation to work performed
 Must include delay times e.g.: waiting for parts etc.
 Timecard confirmation review process in place.', 2, '00000000-0000-0000-0000-000000000001', 'Time Confirmation', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(99, '2025-11-26 05:12:40.699019+00', '2025-11-26 05:40:35.005+00', 50, '', 'Daily Review to identify potential improvement opportunities
 Agenda followed and minuted
 Identify what went well
 Identify what did not go well
 Identify what can be done to prevent recurrence of non-conformances
 Discuss any  Notifications raised or whether or not a Noti is required for something', 2, '00000000-0000-0000-0000-000000000001', 'Meetings - 24-hour daily review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(103, '2025-11-26 05:13:04.070543+00', '2025-11-26 05:41:03.767+00', 50, '', 'Clear diliniation between reliability & Planning, maintenance, supply & operations is key to process consiistency and efficiency', 6, '00000000-0000-0000-0000-000000000001', 'Roles / Responsibilities', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(96, '2025-11-26 05:12:24.822606+00', '2025-11-26 05:40:09.56+00', 49, '', 'The Closing / confirming process is a critical step in WMP performance metrics and must be done in a timely manner.', 3, '00000000-0000-0000-0000-000000000001', 'Closing Work Orders', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(100, '2025-11-26 05:12:44.755701+00', '2025-11-26 05:40:42.996+00', 50, '', 'Appropriate metrics must be in place to measure effectiveness of process:
 Metrics developed 
 Posted in appropriate work areas
 Utilised to drive behaviour change
 Review of overdue statutory requirements', 3, '00000000-0000-0000-0000-000000000001', 'KPI data', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(104, '2025-11-26 05:13:15.258226+00', '2025-11-26 05:43:04.914+00', 51, '', 'A process exists to capture Operation lossesandequipmentdowntime/delays', 1, '00000000-0000-0000-0000-000000000001', 'Operation Loss Monitoring', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(97, '2025-11-26 05:12:30.230143+00', '2025-11-26 05:40:17.287+00', 49, '', 'It is important that repairable, rotable and left over materials are well managed and consider:
 Must be done in a timely manner
 Ensures a safe workplace
 Correct information must be supplied
 Install / Dismantle procedures for Rotables is followed
 There are no outstanding material requirements on TECO''ed work orders.', 4, '00000000-0000-0000-0000-000000000001', 'Material Management - Complete', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(101, '2025-11-26 05:12:52.651876+00', '2025-11-26 05:40:48.497+00', 50, '', 'Interaction between the WMP and the Reliability Processes (Defect Elimination & Asset Strategy & Tactics) is crucial and must include:
 Loss Analysis data
 Repetitive failures occurrences (chronic/systemic)
 Changes in Tactics
 Changes in operating conditions
 Improvements or recommendations
 Cost over-runs', 4, '00000000-0000-0000-0000-000000000001', 'Work Management Feedback to / Inclusion of Reliability Group', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(105, '2025-11-26 05:13:21.840219+00', '2025-11-26 05:43:08.484+00', 51, '', 'Defects are identified through the analysis of various sources of data. 
Potential data sources include:
 Operation Performance data
 Maintenance History / Work Order data
 Logbook data
 Visual Work Place.', 2, '00000000-0000-0000-0000-000000000001', 'Data Sources for Defect Identification', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(106, '2025-11-26 05:13:27.103105+00', '2025-11-26 05:43:18.17+00', 51, '', 'A process is in place to capture defects through observations and escalate into DE process (as appropriate)
Sources of observation data:
 Direct observation
 Interviews
 Safety interactions
 Floor Tours / Task Analysis.', 3, '00000000-0000-0000-0000-000000000001', 'Observations Leading to Defect Identification', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(107, '2025-11-26 05:13:49.223297+00', '2025-11-26 05:43:28.726+00', 51, '', 'A process exists to capture defects identified by incident investigations.', 4, '00000000-0000-0000-0000-000000000001', 'Incident Investigations', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(110, '2025-11-26 05:14:01.488335+00', '2025-11-26 05:43:53.679+00', 51, '', 'Is there a process in place to identifypotentialdefectsduring the feasibility review and design phases of new projects and equipment?', 7, '00000000-0000-0000-0000-000000000001', 'NewEquipmentDefectIdentification', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(112, '2025-11-26 05:14:15.380938+00', '2025-11-26 05:44:26.425+00', 52, '', 'A Defect Register is used to capture all potential defect projects. This facilitates the prioritisation of defects and the effective allocation of resources.', 2, '00000000-0000-0000-0000-000000000001', 'Defect Register', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(113, '2025-11-26 05:14:19.63922+00', '2025-11-26 05:44:33.21+00', 52, '', 'A decision is made as to whether a team-based approach is necessary or if the defect can be assigned to an individual to "just do it". 
There are agreed triggers to initiate the defect elimination process', 3, '00000000-0000-0000-0000-000000000001', 'Selection of Process', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(115, '2025-11-26 05:14:26.937652+00', '2025-11-26 05:44:51.584+00', 52, '', 'The Defect Elimination process is aligned with other Business Improvement initiatives on site? (i.e. MoC, continuous improvement etc).', 5, '00000000-0000-0000-0000-000000000001', 'Process Alignment', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(117, '2025-11-26 05:14:40.475492+00', '2025-11-26 05:45:10.895+00', 53, '', 'Multiple Root Cause Analysis (RCA) methods are made available to the DE Team and are personnel trained in their use.', 1, '00000000-0000-0000-0000-000000000001', 'Root Cause Analysis (RCA) Methods', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(119, '2025-11-26 05:14:49.537185+00', '2025-11-26 05:45:22.386+00', 53, '', 'A Team Charter is developed for each DE Team that includes a clear problem statement.', 3, '00000000-0000-0000-0000-000000000001', 'Problem Statement', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(121, '2025-11-26 05:14:58.777111+00', '2025-11-26 05:45:54.45+00', 53, '', 'The RCA documentation is accessible so others in Aurizon may reference them if they have similar issues.', 5, '00000000-0000-0000-0000-000000000001', 'Documentation of RCA', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(122, '2025-11-26 05:15:09.538791+00', '2025-11-26 05:46:04.543+00', 54, '', 'Are all potential solutions and actions evaluated by the responsible DE Team or individual and are they formally documented?
Solutions and actions have to address the root causes as well as any contributing factors.', 1, '00000000-0000-0000-0000-000000000001', 'Identify potential actions', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(124, '2025-11-26 05:15:18.670275+00', '2025-11-26 05:46:18.611+00', 54, '', 'Detailed action plans developed with clear accountability.
 Action plans should include:
 Actions
 Accountability
 Targets & deliverables
 Status.', 3, '00000000-0000-0000-0000-000000000001', 'Action Plan', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(126, '2025-11-26 05:16:49.560228+00', '2025-11-26 05:46:37.494+00', 55, '', 'Proper approval is obtained for all actions prior to implementation (i.e.: change management).', 1, '00000000-0000-0000-0000-000000000001', 'Approval', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(128, '2025-11-26 05:17:03.801635+00', '2025-11-26 05:47:27.111+00', 55, '', 'The DE Team''s actions and progress reviewed at the monthly DE Management Team meeting. Any slippage in actions must be addressed through additional resources, tools or collaboration.', 3, '00000000-0000-0000-0000-000000000001', 'Action close out', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(129, '2025-11-26 05:17:08.204424+00', '2025-11-26 05:47:33.936+00', 55, '', 'DE Team progress is tracked using various documents?
 Meeting Minutes
 Who Does What When List (Actions Log)
 Defect Register.', 4, '00000000-0000-0000-0000-000000000001', 'Tracking Progress', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(131, '2025-11-26 05:17:21.615193+00', '2025-11-26 05:47:59.944+00', 56, '', 'The DE Teams should be regularly reporting progress back through to the DE Management Team.', 2, '00000000-0000-0000-0000-000000000001', 'DE Management Review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(132, '2025-11-26 05:17:27.511913+00', '2025-11-26 05:48:05.845+00', 56, '', 'The long-term sustainability actions are assured through scheduled reviews of past DE projects.', 3, '00000000-0000-0000-0000-000000000001', 'Sustainability', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(134, '2025-11-26 05:17:37.905961+00', '2025-11-26 05:48:23.117+00', 56, '', 'The DE Management Team gives recognition and feedback for success to the DE team members?', 5, '00000000-0000-0000-0000-000000000001', 'Recognition', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(135, '2025-11-26 05:22:09.134284+00', '2025-11-26 05:49:12.24+00', 57, '', 'Criticality Analysis is important for determining where to focus Asset Tactic Development activities.  Criticality is based on consequence and likelihood.  Categories may include:
 Safety, Health & Environmental
 Costs
 Operational.', 0, '00000000-0000-0000-0000-000000000001', 'Asset Criticality', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(139, '2025-11-26 05:22:49.484457+00', '2025-11-26 05:49:44.448+00', 58, '', 'A team-based approach to Asset Tactic Development will improve the effectiveness of the overall program.  Teams are normally involved in the development & implementation steps:
 Asset Tactic Development analysis
 Data gathering
 Field Validation.', 2, '00000000-0000-0000-0000-000000000001', 'Team-Based Tactics Development', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(142, '2025-11-26 05:23:05.135425+00', '2025-11-26 05:50:03.617+00', 58, '', 'Key Roles are important for the development and implementation of tactics development analyses and their sustainability. Key Roles are:
 Process Owner 
 Process Champion or Sponsor
 Asset Tactic Development Analyst.', 5, '00000000-0000-0000-0000-000000000001', 'Key Roles', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(144, '2025-11-26 05:23:14.271228+00', '2025-11-26 05:53:21.609+00', 59, '', 'It is important to record the decision-making history behind tasks and intervals used in a maintenance strategy.  This will facilitate:
 Review and updating of tactics
 Identifying gaps in information needs.', 1, '00000000-0000-0000-0000-000000000001', 'Decision History', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(146, '2025-11-26 05:23:29.744628+00', '2025-11-26 05:54:10.137+00', 60, '', 'Tasks effectiveness is influenced in how they are presented as service sheets or other such documentation. Documentation guidelines should exist as:
 Standard templates
 Standard terminology
 Clearly defined fields for feedback
 Methods of emphasis.', 1, '00000000-0000-0000-0000-000000000001', 'Document Design', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(148, '2025-11-26 05:23:37.636448+00', '2025-11-26 05:54:22.397+00', 60, '', 'Tasks must integrate with the current maintenance program.  Careful consideration must be taken to how tasks are packaged and scheduled in the maintenance program.', 3, '00000000-0000-0000-0000-000000000001', 'Task Packaging', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(152, '2025-11-26 05:24:01.199269+00', '2025-11-26 05:54:59.851+00', 61, '', 'Collaboration is important to share information and resources across organizations to help improve Asset Tactic Development outcomes.  Collaboration can come in many forms:
 Asset Management (AM) engagements
 Common Practice Work Groups (CPWGs)
 Multi-Site Projects.', 3, '00000000-0000-0000-0000-000000000001', 'Collaboration', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(153, '2025-11-26 05:24:06.570307+00', '2025-11-26 05:55:09.285+00', 61, '', 'A process exists to ensure recommendations for tactics improvement generated from the Defect Elimination process are reviewed and incorporated into existing asset tactics.', 4, '00000000-0000-0000-0000-000000000001', 'Asset Tactics Integrated with Defect Elimination', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(154, '2025-11-26 05:24:10.831376+00', '2025-11-26 05:55:16.801+00', 61, '', 'Management support is needed to ensure the process is producing results and can continue to improve.', 5, '00000000-0000-0000-0000-000000000001', 'Senior Management Support', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(158, '2025-11-26 05:24:29.363905+00', '2025-11-26 05:55:46.688+00', 61, '', 'The Asset Tactic Development process should be an integral part of the acquisition of new equipment:
  Identify costly failure modes
 Ensure maintenance support requirements are met 
  Identify design changes to ensure maintainability
 Determine life cycle expectations
 Develop critical spares listings.', 9, '00000000-0000-0000-0000-000000000001', 'Acquisition of New Equipment', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(155, '2025-11-26 05:24:15.892244+00', '2025-11-26 05:55:22.411+00', 61, '', 'To sustainably manage and improve the Asset Tactics the organisation should have a clearly defined and documented Asset Tactics Development (AS&T) process.', 6, '00000000-0000-0000-0000-000000000001', 'The Asset Tactic Development Process', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(159, '2025-11-26 05:24:35.658055+00', '2025-11-26 05:55:53.005+00', 61, '', 'Incorporating  new technologies into the current maintenance plan to reduce reliance on physical inspections and calendar-based maintenance is an important part of the Asset Tactic Development Process.
There should be mechanisms in place to prompt a review of Tactics where new or previously unknown technologies are identified.', 10, '00000000-0000-0000-0000-000000000001', 'New Technology', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(156, '2025-11-26 05:24:21.321871+00', '2025-11-26 05:55:29.685+00', 61, '', 'There should be clearly defined links between the Work Management Analyse Step and Asset Tactic Development to facilitate the review of Tactics identified as possibly not addressing the relevant failure modes. 
This is one of the key maintenance business improvement steps.', 7, '00000000-0000-0000-0000-000000000001', 'Links to Work Management', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(160, '2025-11-26 05:24:42.060685+00', '2025-11-26 05:56:03.383+00', 61, '', 'The Asset Tactic Development program should increase the reliability and performance of equipment under its governance.  Metrics or KPI''s are established to measure the effectiveness and output of the  Asset Tactic Development process and to identify where Tactics may need to be reviewed. Some measures are: 
 Equipment performance metrics
 Unscheduled work spend
  Cost avoidance
  AR''s completed in a timely manner.', 11, '00000000-0000-0000-0000-000000000001', 'Performance Metrics', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(64, '2025-11-26 05:07:31.357513+00', '2025-11-26 05:32:27.531+00', 45, '', 'Inspection checklists are up-to-date and aligned with equipment maintenance strategy. (Daily, Weekly, Monthly) considering:
 Safety
 Materials
 Tasks including specification
 Additional Resources
 Feedback / comments field
 Sign off.', 4, '00000000-0000-0000-0000-000000000001', 'Inspection Checklist Design - Maintainers', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(65, '2025-11-26 05:07:37.947273+00', '2025-11-26 05:32:40.204+00', 45, '', 'All work requests are  recorded in the SAP as Notifications. This includes identifying work found as a result of  Reliability inspections.  
Adequate information to process the notification is included:
   What:   A description of the fault or request for maintenance, including any troubleshooting performed
  Where:  Identifies the maintainable item requiring maintenance
  When:   Pinpoints when the fault occurred and sets the priority for the task 
to be performed
  Why:  Relates why the work need to be performed (failure modes)', 5, '00000000-0000-0000-0000-000000000001', 'Maintenance Request / Notification Process', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(67, '2025-11-26 05:08:04.932909+00', '2025-11-26 05:33:04.772+00', 45, '', 'For effective planning of maintenance tasks, Operations, Maintenance and Service providers must review Notifications on a regular basis, and ensure that incorrectly coded notifications are recoded for processing.', 7, '00000000-0000-0000-0000-000000000001', 'Work Request / Notification Review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(69, '2025-11-26 05:09:07.380228+00', '2025-11-26 05:33:45.906+00', 45, '', 'Improvement work may flow in from a number of sources: 
 Environment, health, safety and community relations
 Incident investigations
 Reliability analyses
 Defect elimination investigations
 Operation uptime initiatives
 Cost reduction analyses
 Asset life cycle plan.', 9, '00000000-0000-0000-0000-000000000001', 'Identify Improvement Work', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(70, '2025-11-26 05:09:20.444141+00', '2025-11-26 05:33:59.988+00', 45, '', 'Subsequent, or related, notifications can be coded as such in the SAP.  Some items to note:
  A subsequent notification should be created if additional work is discovered while performing a task on a work order.
  The original work order can be categorized as any type of maintenance work.  However, subsequent notifications are most often found while performing PM work.', 10, '00000000-0000-0000-0000-000000000001', 'Identify Additional Work Found During Work Execution', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(72, '2025-11-26 05:09:47.861652+00', '2025-11-26 05:34:40.378+00', 46, '', 'Capital Planning tasks are managed by Long Term Planning (26 weeks to 3 weeks).  Clear differentiation of maintenance tasks required to assign maintenance planner form Asset Management & Strategy or Business Unit.', 2, '00000000-0000-0000-0000-000000000001', 'Long Term Planning Horizons & Tasks', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(73, '2025-11-26 05:09:55.837657+00', '2025-11-26 05:34:46.763+00', 46, '', 'To reduce the amount of work, and support continuous improvement, standard jobs or task lists should be used during the planning process.
A Job should only ever be planned once, saved as a task list or standard job, and then improved over time.', 3, '00000000-0000-0000-0000-000000000001', 'Task List / Standard Jobs', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(75, '2025-11-26 05:10:07.819808+00', '2025-11-26 05:35:04.616+00', 46, '', 'The SAP must be actively managed to ensure the Work Management process works properly and efficiently, and data is available for later reliability analysis. Data requiring management may include:
 Proper work order coding with regards to user statuses
 Differentiating warranty work
 Install / Dismantle of equipment (rotables)
 Review of job plans requiring complex planning', 5, '00000000-0000-0000-0000-000000000001', 'SAP Management', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(76, '2025-11-26 05:10:14.332094+00', '2025-11-26 05:35:14.079+00', 46, '', 'Before work commences, and to allow for effective execution of the planned work, maintainers must be provided with a complete work package.  Depending on the size/duration/complexity of the job, a work package may be a binder, or simply a printed job card (shop paper).
Work Packs should include:
 Start-up, test, demob and clean-up requirements including return of unused parts and repairables
 Materials listing
 Space for feedback
 Gantt charts (if applicable)', 6, '00000000-0000-0000-0000-000000000001', 'Work Packages', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(77, '2025-11-26 05:10:19.956875+00', '2025-11-26 05:35:35.638+00', 46, '', 'An effective parts management process incorporates the following criteria. 
 Up to date Bill of Material (BOM''s) & inventory levels          
 Parts ordered from BOM''s, or updated if not
 Correct requisitioning, to the correct work order and use of lead times
 Effective Planner / Warehouse communications
 Parts tracking monitored
 Use of Materials Availability reporting, if available', 7, '00000000-0000-0000-0000-000000000001', 'Material Management - Process', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(79, '2025-11-26 05:10:28.530432+00', '2025-11-26 05:36:19.306+00', 46, '', 'Planners should remain focused on planning future work, without distraction from supervision tasks, or managing breakdowns and interrupt work, and associated emergency parts procurement.', 9, '00000000-0000-0000-0000-000000000001', 'Roles / Responsibilities', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(80, '2025-11-26 05:10:36.347461+00', '2025-11-26 05:36:43.808+00', 47, '', 'Long term, rough-cut schedules must be developed to assist with budgeting and co-coordinating of major maintenance shutdowns and other significant events affecting operations planning and consider:
 Rough-cut capacity scheduling is a key element of forward log maintenance planning
 Maintenance and operations schedules are integrated', 1, '00000000-0000-0000-0000-000000000001', 'Long Term Scheduling Time Horizons', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(82, '2025-11-26 05:10:47.530927+00', '2025-11-26 05:37:10.83+00', 47, '', 'Some guidelines for effective utilization of all resources must be communicated and followed and include:
 No standing work orders used
 Loading per person per week in hours
 Non-maintenance activities are deducted from available hours
 Work centre resource management
 Review of KPI''s to determine proper schedule loading', 3, '00000000-0000-0000-0000-000000000001', 'Schedule Resource Loading', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(83, '2025-11-26 05:10:59.244261+00', '2025-11-26 05:37:28.889+00', 47, '', 'There should be formal ''schedule'' meetings.
 Operations and maintenance sit down to discuss the proposed schedule. This is done in tandem with the operations schedule. Any active discussions regarding schedule inclusions should happen at this meeting.
 The teams get back together to formally lock down the schedule. This discussion should be a formality and should rarely involve disagreements on the schedule inclusions. The timing of the second meeting is usually dictated by the lock-down date in the SAP.', 4, '00000000-0000-0000-0000-000000000001', 'Scheduling Review/Lock in Meetings', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(136, '2025-11-26 05:22:11.297489+00', '2025-11-26 05:49:18.372+00', 57, '', 'It is important for determining where to focus Asset Tactic Development activities. Risk Management is based on consequence and likelihood utilising the Aurizon Enterprise Risk Management Framework and Appetite.
Categories may include:
 Safety & Environmental
 Costs
 Operation.', 1, '00000000-0000-0000-0000-000000000001', 'Risk Management', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(157, '2025-11-26 05:24:26.622761+00', '2025-11-26 05:55:39.807+00', 61, '', 'This process will ensure equipment modifications have been reviewed to ensure they will be supported by the maintenance function prior to being operational.', 8, '00000000-0000-0000-0000-000000000001', 'Equipment Modification Review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(85, '2025-11-26 05:11:10.52945+00', '2025-11-26 05:37:52.457+00', 47, '', 'Best practice would see materials managed using a Just-in-Time philosophy. This minimises stocked inventory and, in turn costs. However, particularly for isolated depot/P&Es with potential supply chain logistics issues, this is not always practical.
It is accepted that, in order to reduce the risks presented by these issues Aurizon depot/P&Es should be protecting their maintenance schedules by ensuring spares and materials are on depot/P&E before the Operations are scheduled.', 6, '00000000-0000-0000-0000-000000000001', 'Material Management - Scheduled Spares', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(86, '2025-11-26 05:11:16.470178+00', '2025-11-26 05:38:03.828+00', 47, '', 'Priorities of work to be determined based on set guidelines and in line with maintenance and operations requirements considering:
 Input based on operations objectives
 Safety / Environmental priorities
 Support equipment availability
 Possible contingency plans                                        
 Review of Materials availability                                 
 Schedule needs to be agreed & confirmed                          
 Work packages and/or job cards are part of published schedule', 7, '00000000-0000-0000-0000-000000000001', 'Weekly Schedule (Quality) Output', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(88, '2025-11-26 05:11:25.611599+00', '2025-11-26 05:38:26.284+00', 48, '', 'Formal procedure for interaction between maintainer and operator at equipment exchange (shut down and release) and incorporate the following:
 Actions required or taken
 Permits & isolation concerns
 Status / condition of equipment
 Equipment / functional testing after maintenance
 Timely acceptance by operator(s) upon release
 All tests, clean-up, demob, parts & repairables returned.', 1, '00000000-0000-0000-0000-000000000001', 'Equipment Handover & Release', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(90, '2025-11-26 05:11:40.991339+00', '2025-11-26 05:38:44.058+00', 48, '', 'To monitor work execution activities and provide feedback on progress and quality of work
 SHE is observed, questioned and corrected
 Work quality interaction
 Delays recorded
 Actions & contingencies listed
 Improvement opportunities identified.', 3, '00000000-0000-0000-0000-000000000001', 'Floor tours', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(91, '2025-11-26 05:11:44.088887+00', '2025-11-26 05:39:22.725+00', 48, '', ' Spares should be managed as close to a just in time approach as possible without creating undue business risk.
 Spares should be kitted & staged and delivered to the scheduled spares area on the day required.
 All spares should be managed within the stores.
 BOM''s should be immediately updated when found to be incorrect to ensure parts aren''t over or under ordered for jobs.', 4, '00000000-0000-0000-0000-000000000001', 'Material Management - Execution Spares', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(93, '2025-11-26 05:11:54.107405+00', '2025-11-26 05:39:45.229+00', 49, '', ' Aurizon training should be formally provided to new employees and any necessary contractors, and if necessary refreshed annually 
 Online training material is readily available and linked to the relevant sections of the WMP.', 0, '00000000-0000-0000-0000-000000000001', 'Work Order Completion & Confirmation Training', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(98, '2025-11-26 05:12:38.03418+00', '2025-11-26 05:40:28.909+00', 50, '', 'Weekly plans, schedules and metrics reviewed to identify potential improvement opportunities.
 Participation from both maintenance, operations and service departments such as Warehouse
 Agenda followed and minuted
 Identify what went well
 Identify what did not go well - potential improvements
 Identify what can be done to prevent recurrence of non-conformance.', 1, '00000000-0000-0000-0000-000000000001', 'Meetings - Weekly Review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(102, '2025-11-26 05:12:57.393316+00', '2025-11-26 05:40:56.938+00', 50, '', 'A SAP is an essential part of the Asset Management Business Process.  The extent to which it is developed and used can create a significant impact on the capability and effectiveness of a site''s asset management function.  This practice aims to understand the level of maturity of the SAP on the site.', 5, '00000000-0000-0000-0000-000000000001', 'SAP/ERP (Enterprise Resource Planning)', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(108, '2025-11-26 05:13:54.160444+00', '2025-11-26 05:43:32.97+00', 51, '', 'The Defect Elimination (DE) Management Team meets monthly to identify new DE projects and review current projects? The following functions should be presented in the DE Management Team meeting:
 Operations
 Maintenance
 Logistics.', 5, '00000000-0000-0000-0000-000000000001', 'DE Management Team', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(109, '2025-11-26 05:13:59.136896+00', '2025-11-26 05:43:45.331+00', 51, '', 'Is there a process in place to identifypotentialdefectsthat have a high consequence and low probability of occurring?', 6, '00000000-0000-0000-0000-000000000001', 'PotentialCriticalDefectIdentification', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(111, '2025-11-26 05:14:10.547336+00', '2025-11-26 05:44:20.722+00', 52, '', 'Defects are assessed and prioritised by quantifying the risk and value of eliminating the defect.
Estimates must be made for the following factors:
 Value of eliminating the defect
 Risk the defect poses to the business
 Difficulty in eliminating the defect
 Cost to eliminate defect.', 1, '00000000-0000-0000-0000-000000000001', 'Assess and Prioritise Defects', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(114, '2025-11-26 05:14:24.611718+00', '2025-11-26 05:44:42.78+00', 52, '', 'Teams are selected to work on Defect Elimination projects. The DE Management team must ensure the team is sufficiently resourced.', 4, '00000000-0000-0000-0000-000000000001', 'DE Team Selection', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(116, '2025-11-26 05:14:33.039177+00', '2025-11-26 05:44:56.765+00', 52, '', 'Undesirable events are analysed in Pareto format and presented at the Monthly DE Management Team meeting.', 6, '00000000-0000-0000-0000-000000000001', 'Data Presentation', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(118, '2025-11-26 05:14:44.696739+00', '2025-11-26 05:45:18.087+00', 53, '', 'There are many methods and processes available to assist in the identification of the root causes of a defect.
The specific method chosen will depend on a number of factors:
 Problem complexity
 Risk defect poses
 Problem Dimensions
 If a team is being used.', 2, '00000000-0000-0000-0000-000000000001', 'Selection of RCA method', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(120, '2025-11-26 05:14:53.761295+00', '2025-11-26 05:45:34.669+00', 53, '', 'Key stakeholders are represented in the Defect Elimination Team to provide input into the problem and solution analysis? Teams should include roles such as:
 Facilitator
 Team Leader
 Reliability Engineer
 Team Members (representing areas effected).', 4, '00000000-0000-0000-0000-000000000001', 'Team Composition', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(123, '2025-11-26 05:15:14.35085+00', '2025-11-26 05:46:12.834+00', 54, '', 'All potential actions are evaluated against specific criteria. Actions should be evaluated in terms of:
 Addressing the root cause
 SHE Implications
 Cost to implement
 Ease of implementation.', 2, '00000000-0000-0000-0000-000000000001', 'Evaluation of potential actions', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(125, '2025-11-26 05:15:20.679771+00', '2025-11-26 05:46:27.295+00', 54, '', 'A measurement plan is in place that includes a baseline with appropriate measures / KPI and targets.', 4, '00000000-0000-0000-0000-000000000001', 'Establish a measurement plan', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(127, '2025-11-26 05:16:57.753031+00', '2025-11-26 05:47:20.528+00', 55, '', 'Clear accountabilities are established for the completion of the action plan and is it syndicated with management. 
Accountabilities to include:
 Project management
 Action completion
 Action management
 Cost management
 Monitoring progress.', 2, '00000000-0000-0000-0000-000000000001', 'Accountability', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(130, '2025-11-26 05:17:13.631146+00', '2025-11-26 05:47:54.022+00', 56, '', 'An effective business process should be defined for defect elimination.', 1, '00000000-0000-0000-0000-000000000001', 'Business process for defect elimination', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(133, '2025-11-26 05:17:32.248346+00', '2025-11-26 05:48:15.565+00', 56, '', 'The outcomes of the DE Project are updated in the Defect Register and are the outcomes syndicated?', 4, '00000000-0000-0000-0000-000000000001', 'Outcomes', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(137, '2025-11-26 05:22:16.972357+00', '2025-11-26 05:49:29.263+00', 58, '', 'A database is important to document analysis and track decision making history. Some other functions of a database are:
 Developing equipment hierarchies & structures
 Statistical Analysis
 Asset Tactic Development database containing common failure mechanisms etc.', 0, '00000000-0000-0000-0000-000000000001', 'Asset Tactic Development Database', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(138, '2025-11-26 05:22:33.335977+00', '2025-11-26 05:49:38.104+00', 58, '', 'A process should be in place which will trigger a re-evaluation of tactics.  Triggers for re-evaluation can include:
 Time-Based
 Poor Performance
 Change in conditions
 Defect Elimination
 Change in operating context.', 1, '00000000-0000-0000-0000-000000000001', 'Review of Tactics', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(140, '2025-11-26 05:22:54.367565+00', '2025-11-26 05:49:50.277+00', 58, '', 'Tactics development projects are prioritised and selected based on specific criteria:
 Criticality
 Performance
 Value.', 3, '00000000-0000-0000-0000-000000000001', 'Selection of Projects', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(141, '2025-11-26 05:23:00.477802+00', '2025-11-26 05:49:55.123+00', 58, '', 'Any tactics development project must include some level of FMECA/RCM/PMO analysis.  Steps involve identifying:
 Functions
 Functional Failures
 Failure Modes
 Failure Effects
 Failure Consequences
 Task Evaluation and Selection (RCM).', 4, '00000000-0000-0000-0000-000000000001', 'FMECA/RCM Process', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(143, '2025-11-26 05:23:07.586253+00', '2025-11-26 05:50:20.666+00', 58, '', 'Suitable Asset Tactic Development methodologies require properly trained and experienced personnel to ensure the effectiveness of the Asset Tactic Development program.  Training should be ongoing and include training plans for:
 Management
 Asset Tactic Development practitioners
 Team Members.', 6, '00000000-0000-0000-0000-000000000001', 'Tactics development Training', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(145, '2025-11-26 05:23:24.044914+00', '2025-11-26 05:53:28.896+00', 59, '', 'Tasks and associated intervals recorded in a Tactics database should reflect the actual maintenance strategies in use:
 Tasks (and intervals) for critical equipment should exist in the Asset Tactic Development database
 Tasks for critical equipment should have had some level of FMECA/RCM analysis.', 2, '00000000-0000-0000-0000-000000000001', 'Asset Tactic Development-Critical Equipment Tactics', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(147, '2025-11-26 05:23:31.975835+00', '2025-11-26 05:54:14.237+00', 60, '', 'First time execution of a changed or newly created tactic must be evaluated in the field. Not validating tasks in the field will lead to ineffective tactics and a lack of confidence in the entire program.
Field validation should focus on ensuring:
 Safety, Ergonomic or Environmental issues resolved
 Proper sequencing of tasks
 Equipment access issues
 Identify tools and parts requirements
 Identify training needs.', 2, '00000000-0000-0000-0000-000000000001', 'Field Validation', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(149, '2025-11-26 05:23:45.028108+00', '2025-11-26 05:54:27.851+00', 60, '', 'Change Management procedures are crucial to ensure maintenance tasks & procedures comply with the selected methodology (e.g., RCM, FMECA,  PMO) principles
 Safety
 Materials
 Tasks including specification.', 4, '00000000-0000-0000-0000-000000000001', 'Change Management', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(150, '2025-11-26 05:23:50.974234+00', '2025-11-26 05:54:40.572+00', 61, '', 'A continuous process of improving maintenance tactics requires the monitoring of various sources of information on equipment performance and task effectiveness:
 Cost Reports
 Trend Analysis
 Failure Analysis
 Tactics Review
 Defect Elimination
 Integrity Risk Assessment.', 1, '00000000-0000-0000-0000-000000000001', 'Asset Performance Review', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL),
	(151, '2025-11-26 05:24:00.14313+00', '2025-11-26 05:54:54.431+00', 61, '', 'PMO is a review of equipment performance to determine the effectiveness of tactics already in place and:
 Maybe used for equipment with significant history and well understood life cycles
 Is a method to rapidly review current tactics in bulk.', 2, '00000000-0000-0000-0000-000000000001', 'PMO (Preventative Maintenance Optimisation)', false, NULL, 5, '4c23fe1d-5f30-47ae-a292-51d5e8109ecf', NULL);


